create table MOCK_DATA (
    id INT,
    first_name CHARACTER VARYING(50),
    last_name CHARACTER VARYING(50),
    email CHARACTER VARYING(50),
    gender CHARACTER VARYING(50),
    ip_address CHARACTER VARYING(20),
    primary key (id),
    unique (email)
);


SELECT * FROM MOCK_DATA WHERE email = 'jmillanrf@newyorker.com';
SELECT * FROM MOCK_DATA WHERE last_name = 'Ramalhete';
SELECT first_name FROM MOCK_DATA OFFSET 15 LIMIT 10;
